	@SuppressWarnings("unchecked")
	private List<Map<String, Object>> transformForD3(String resultJson) {
		List<Map<String, Object>> finalJson = new ArrayList<Map<String, Object>>();
		try {
			Map<String, Object> outMap = this.parser.parseMap(resultJson);
			List<Integer> upper90List = (List<Integer>) outMap.get("Upper90");
			List<Integer> upper95List = (List<Integer>) outMap.get("Upper95");
			List<Integer> lower90List = (List<Integer>) outMap.get("Lower90");
			List<Integer> lower95List = (List<Integer>) outMap.get("Lower95");
			List<Integer> salesList = (List<Integer>) outMap.get("Sales");
			List<Date> dateList = (List<Date>) outMap.get("Date");
			List<String> remarksList = (List<String>) outMap.get("Remarks");
			finalJson = new ArrayList<Map<String, Object>>();
			Map<String, Object> finalMap = new HashMap<String, Object>();
			for(int i = 0; i < dateList.size(); i++) {
				finalMap = new HashMap<String, Object>();
				finalMap.put("Date", dateList.get(i));
				finalMap.put("Upper90", upper90List.get(i));
				finalMap.put("Sales", salesList.get(i));
				finalMap.put("Upper95", upper95List.get(i));
				finalMap.put("Lower90", lower90List.get(i));
				finalMap.put("Lower95", lower95List.get(i));
				finalMap.put("Remarks", remarksList.get(i));
				finalJson.add(finalMap);
			}
			
        } catch(Exception e) {
        	throw new RuntimeException("Fail, could not parse");
        }
		return finalJson;
	}
	
	@RequestMapping("/runAnalytic")
	public String runAnalytic(@RequestParam("id") String id, @RequestParam("body") String body) throws IOException {		
		List<Header> headers = this.restClient.getSecureTokenForClientId();
		
		this.restClient.addZoneToHeaders(headers, this.zoneId);
		String url = getAnalyticServiceUrl(id);
		
		CloseableHttpResponse response = this.restClient.post(url, body, headers);
		
		System.out.println(response.getStatusLine());
		String output="unprocessed";
		
		try {
			Map<String,Object> resMap = this.parser.parseMap(EntityUtils.toString(response.getEntity()));
			output = resMap.get("result").toString();
        } finally {
            response.close();
        }
		return output;
	}
	
	
